import React from 'react'
import useNavigate from 'react-router-dom'
// import 
const Logout = () => {
  
 const  Sendoutside=()=>{
  const Navigate = useNavigate();
  Navigate("./")
  }
  return (
    <div className='Lcont'>
      <a onClick={Sendoutside}>Logout</a>
    </div>
  )
}

export default Logout
